import React from 'react';

const Dashboard = () => {
  return (
    <div>
      <h2>Dashboard</h2>
      <p>Recent innovations in Generative AI...</p>
      <p>Source: <a href="https://example.com">https://example.com</a></p>
      <p>This project uses React for the frontend, Node.js for the backend, and MySQL for the database.</p>
    </div>
  );
};

export default Dashboard;
